INSERT INTO blog_wfIssues VALUES("8","1531304017","1531304017","new","wfPluginUpgrade","2","c019c317ed11ae3ae10647e401a5e58e","c019c317ed11ae3ae10647e401a5e58e","The Plugin \"WPBakery Visual Composer\" needs an upgrade (5.2.1 -> 5.5.2).","You need to upgrade \"WPBakery Visual Composer\" to the newest version to ensure you have any security fixes the developer has released.","a:16:{s:4:\"Name\";s:24:\"WPBakery Visual Composer\";s:9:\"PluginURI\";s:22:\"http://vc.wpbakery.com\";s:7:\"Version\";s:5:\"5.2.1\";s:11:\"Description\";s:233:\"Drag and drop page builder for WordPress. Take full control over your WordPress site, build any layout you can imagine – no programming knowledge required. <cite>By <a href=\"http://wpbakery.com\">Michael M - WPBakery.com</a>.</cite>\";s:6:\"Author\";s:58:\"<a href=\"http://wpbakery.com\">Michael M - WPBakery.com</a>\";s:9:\"AuthorURI\";s:19:\"http://wpbakery.com\";s:10:\"TextDomain\";s:11:\"js_composer\";s:10:\"DomainPath\";s:0:\"\";s:7:\"Network\";b:0;s:5:\"Title\";s:61:\"<a href=\"http://vc.wpbakery.com\">WPBakery Visual Composer</a>\";s:10:\"AuthorName\";s:24:\"Michael M - WPBakery.com\";s:10:\"pluginFile\";s:82:\"/opt/lampp/htdocs/payrentz-dev/blog/wp-content/plugins/js_composer/js_composer.php\";s:10:\"newVersion\";s:5:\"5.5.2\";s:4:\"slug\";s:11:\"js_composer\";s:5:\"wpURL\";s:0:\"\";s:10:\"vulnerable\";b:0;}");



