hich you may access through this one. When you access a non-Sole Fitness web site, please understand that it is independent from Sole Fitness, and that Sole Fitness has no control over the content on that web site. In addition, a link to a non-Sole Fitness web site does not mean that Sole Fitness endorses or accepts any responsibility for the content, or the use, of such web site. It is up to you to take precautions to ensure that whatever you select for your use is free of such items as viruses, worms, trojan horses and other items of a destructive nature. IN NO EVENT WILL SOLE FITNESS BE LIABLE TO ANY PARTY FOR ANY DIRECT, INDIRECT, SPECIAL OR OTHER CONSEQUENTIAL DAMAGES FOR ANY USE OF THIS WEBSITE, OR ON ANY OTHER HYPERLINKED WEBSITE, INCLUDING, WITHOUT LIMITATION, ANY LOST PROFITS, BUSINESS INTERRUPTION, LOSS OF PROGRAMS OR OTHER DATA ON YOUR INFORMATION HANDLING SYSTEM OR OTHERWISE, EVEN IF WE ARE EXPRESSLY ADVISED OF THE POSSIBILITY OF SUCH DAMAGES.</p>\n<p>&nbsp;</p>","","3","Terms & Conditions - Payrentz","","tnc, terms and condition","2017-10-13","N","1");
INSERT INTO tbl__businesssolution VALUES("4","2","Menu3","privacy-policy","\n<p>&nbsp;</p>\n<h4>1. Collection of Personal Information:</h4>For availing the Services/Products from the Website or to contact Payrentz, you may have to sign up by giving following personal information such as email address, name, phone number and address. Some of these information provided above are personally sensitive information (\"Personal Informationâ€) and is collected for the purpose of verification of identity of the user and to ensure due compliances. We do use your contact information to send you offers based on your previous orders and your interests. In general, you can browse the Website without telling us who you are or revealing any Personal Information about yourself.Additionally if you browse through this Website, our servers may automatically record information of certain kind. Such information includes information such as the name of the domain and host from which you access the Internet; the Internet Protocol (IP) address of the computer you are using; the date and time of your access. We use this information to monitor the usage of our Website and also whatever is necessary for our business. This information does not include Personal Information.If you choose to post messages on our message boards, chat rooms or other message areas or leave feedback, we will collect that information you provide to us. We retain this information as necessary to resolve disputes, provide customer support and troubleshoot problems as permitted by law. If you send us personal correspondence, such as emails or letters, or if other users or third parties send us correspondence about your activities or postings on the Website, we may collect such information into a file specific to you.<br />\n<br />\n\n<h4>2. Information collected from third party:</h4>We may collect your Personal Information as well as other information from third parties like business partners; contractors; vendors etc and add the same to our account information.<br />\n<br />\n\n<h4>3. Information placed on your computer:</h4>We may store some information such as cookies on your computer. Cookies are pieces of information that an application transfers to the hard drive of a visitors computer for record-keeping purposes. This information facilitates your use of Website and ensures that you do not need to re-enter your details every time you visit it. You can erase or choose to block this information from your computer if you want to. Erasing or blocking such information may limit the range of features available to the visitor on Website. We also use such information to provide visitors a personalized experience on Website. We may use such information to allow visitors to use Website without logging in upon returning.<br />\n\n<h4><br />\n	4. Links:</h4>Our Website may contain links to other sites. Such other sites may use information about your visit to this Website. Our Privacy Policy does not apply to practices of such sites that we do not own or control or to people we do not employ. Therefore, we are not responsible for the privacy practices or the accuracy or the integrity of the content included on such other sites. We encourage you to read the individual privacy statements of such websites.<br />\n<br />\n\n<h4>5. Use of Personal Information:</h4>Website collects and uses your Personal Information to provide you better customer experience and also in the administration of our business. Website may use your Personal Information to administer this service, personalize the Website services for you enable your access to and use of Website services publish information about you on Website to keep you informed or update you on various products and services available from Website send you statements and invoices collect payments from you send you marketing communications to send you mails or contact you for various customer satisfaction surveys, market research, promotional activities or in connection with certain transactions make communications necessary to notify you regarding various security, privacy, and administrative issues to respond to your queries send you information that may be of interest to you, share this information with Services/Products made available through Website to respond to any of your legitimate claim, or to address you if we have reasonable belief, that you are violating the rights of any third party or any of the agreements or policies that govern your use of Website Services/Products conduct research and perform analysis in order to measure, maintain, protect, develop and improve our services.Website has no operations in other countries and we do not transfer Personal Information to other countries. However, if the server space provider as matter of backup or other general practices may transfer the server content between any of the countries in which server provider operates or servers are located to enable the use of the information in accordance with this Privacy Policy, You agree to such cross-border transfers of Personal Information and the risk associated with it.Where Website discloses your Personal Information to any third party for any purpose mentioned above, such third parties are obligated to use that Personal Information in accordance with the terms of this Privacy Policy.In addition to the disclosures reasonably necessary for the purposes identified above, Website may disclose your Personal Information to the extent that it is required to do so by law, in connection with any legal proceedings or prospective legal proceedings, and in order to establish, exercise or defend its legal rights.\n<ul>\n	<ul>\n		<p>&nbsp;</p>\n	</ul>\n</ul>","","4","Privacy Policy - Payrentz","Privacy of individual visitor data is of primary importance to Meini. We work diligently to protect confidentiality, restrict transfer of personal data.","privacy policy, data privacy,  privacy law","2017-10-13","N","1");



