er statute or otherwise) for any loss, damage, or expense (including special, indirect or consequential loss, loss of profit or revenue, loss of use, legal costs and defense or settlement costs) that you or any other person incurs arising directly or indirectly out of or referable to material on this website or to third party material.<br />\n<br />\nLiability of PayRentz for a breach of a condition or warranty implied by law or otherwise, and which cannot be excluded, is limited to the maximum extent the law allows. You must comply with all laws in relation to your access or use of Material on this website, including laws of the country in which you reside or from which you access this website.<br />\n<br />\n<span style=\"font-weight: bold;\">Cancellation<br />\n	</span><br />\nThe agreement set out in these Terms of Use and your access to this website may be cancelled at any time by PayRentz without notice. All restrictions, licenses granted by you and all disclaimers and limitations of liability by PayRentz will continue after cancellation.<br />\n<br />\n<span style=\"font-weight: bold;\">General<br />\n	</span><br />\nEfforts are taken to ensure the accuracy and integrity of information and related materials provided by the firm on this Website, but the firm is not responsible for misprints, out-of-date information, technical or pricing inaccuracies, typographical or other errors appearing on this Website. Information and related materials are subject to change without notice. Any part of these Terms of Use must be read down to the extent necessary to prevent that part or these Terms of Use being invalid, voidable or unenforceable in the circumstances. Despite that reading down, if a part of these Terms of Use is still invalid, voidable or unenforceable, and if the part would not be invalid or voidable if a word or words were removed, then that word or those words will be deleted, and the rest of these Terms of Use will continue to be fully enforceable. A right of PayRentz under these Terms of Use may only be waived in writing signed by PayRentz. You represent and warrant to PayRentz that you are at least 18 years of age and otherwise have the power, authority and capacity to agree to these Terms of Use with PayRentz.<br />\n<br />\n<span style=\"font-weight: bold;\">Description of Products<br />\n	</span><br />\nThe images, pictures, and illustrations found on this site are for illustration purposes only, and do not necessarily represent the exact products, services, or ideas in the context they are found in. It is the clientâ€™s responsibility prior to purchase to clarify with our representative exactly what products and services are being provided for to purchase. We do not warrant that Product description or other content of this Website is accurate, complete, reliable, current, or error-free and assumes no liability in this regard.<br />\n<br />\nThe price indications on the Website may vary due to some technical issue, typographical error or difference in product information and the firm shall not be responsible for the changed prices during the transaction. The terms and conditions of delivery, payment, etc. shall be governed by the Application and Agreement signed at the time of concluding the transaction.<br />\n<br />\n<span style=\"font-weight: bold;\">Rental Payment, Processing Fees and Refunds<br />\n	</span><br />\nOur clients are requested to pay a refundable deposit which is equal to 3 months rent of the product chosen (varies according to each product) and Onetime non refundable processing charges of Rs. 500/- per product.<br />\n<br />\nRefundable deposit will be returned to you after the end of contact period or return of the product as the case may be. The returned products are subjected to quality check either at your place or at our office depending on the availability of our engineers. Upon clearance from quality team the rental deposit will be transferred (NEFT) to your account within one week. Clients are requested to share complete and accurate bank account details at the time of returning the product. Please note that the refundable deposit will be transferred to only the applicant / clientâ€™s bank account, PayRentz do not endorse transacting with any other representative of the applicant unless otherwise the situation warrants such act, however in such an unavoidable situation it will be at the sole discretion of PayRentz. Any cost arising out of damages other than normal wear and tear will be deducted from the deposit.<br />\n<br />\nOur collection executives will visit your place on or before 7th of every month to collect cash or cheque at your convenience. Delayed payment of monthly rentals beyond due date shall attract a penal interest of 2% from the date of default till the time the monthly rental is paid and failure to pay monthly rent before end of the month will result in termination of the agreement and removal of product.<br />\n<br />\nNon-payment of monthly rentals for one month could result in termination of agreement and removal of the products. The products rented from us should be only used for residential and single family use. Unauthorized relocation of products or any commercial use will result in immediate termination of the agreement. The firm will levy a charge of Rs. 500/- for any dishonoring of cheques.<br />\n<br />\n","","1","Disclaimer - PayRentz","We are the sole distributors for international brands such as SOLE, XTERRA and STEX, LIVE UP many of which are award winners with wide literature online. bbbbb","Home appliance on rent","2017-10-13","Y","1");
