l></div>\n		<div class=\"contact-add-div contact-col1\">               \n			<h2><span style=\"color:rgb(111, 53, 158); font-size: 14pt;\">INDIA</span></h2>\n			<p>55 Montieth Road</p>\n			<p>Egmore, Chennai 600 008</p>\n			<p>Tamil Nadu, India<br />\n				</p>               \n			<ul>                \n				                \n				<li class=\"contact-phone\">+91 98840 66622</li>                \n				<li class=\"contact-mail\">info@soletreadmills.in</li>               \n			</ul></div>\n		<div class=\"contact-add-div contact-col1\">               \n			<h2><span style=\"color:rgb(111, 53, 158); font-size: 14pt;\">SRI LANKA</span></h2>\n			<p>Pro Fitness Solutions</p>\n			<p>17 Skelton Gardens</p>\n			<p>Colombo 05</p>\n			<p>Sri Lanka<br />\n				</p>               \n			<ul>                \n				                \n				<li class=\"contact-phone\">+94 777389009<br />\n					+94 773017032</li>\n				<li class=\"contact-phone\">+94 773018637<br />\n					</li>                \n				<li class=\"contact-mail\">solutionsatprofitness@gmail.com</li>\n				<li class=\"contact-mail\">gemunudesoyza@gmail.com<br />\n					</li>               \n			</ul></div></div>            \n	<div class=\"clear\">&nbsp;<a href=\"mailto:solutionsatprofitness@gmail.com\" target=\"_blank\" rel=\"nofollow\" id=\"yui_3_16_0_ym19_1_1483060985705_11827\">solutionsatprofitness@gmail.com</a><br />\n		<a href=\"mailto:gemunudesoyza@gmail.com\" target=\"_blank\" rel=\"nofollow\" id=\"yui_3_16_0_ym19_1_1483060985705_11831\">gemunudesoyza@gmail.com</a></div>            </div>","","2","Contact us - SF Singapore","We are available to answer all your questions on business days between 9am and 9pm. Call us at 6270 3544 / 92703242","sf singapore, sole singapore, live up singapore","2017-10-13","W","1");
INSERT INTO tbl__tlink VALUES("3","2","Terms of Use","terms--conditions","\n<h3 style=\"margin:0 !important\"><span class=\"light\"></span>Terms of Use<br />\n	<br />\n	<span style=\"font-weight: normal;\">Use of this internet site is subject to these Terms of Use. Some uses of this site, including the order of rental of products through this internet site may be subject to additional terms displayed on the relevant pages of this internet site. PayRentz makes no representations or warranties in relation to this internet site, including without limitation: as to the accuracy or completeness of the information on this internet site; or that this internet site will be continuously available or free from any delay in operation or transmission, virus, communications failure, internet access difficulties or malfunction in hardware or software; or that PayRentz endorses any internet site linked to this internet site or any third party products or services referred to on this internet site. PayRentz is not liable for any loss or damage, howsoever caused (including but not limited to, by the negligence of the PayRentz) incurred in connection with this internet site, including but not limited to, as a result of reliance placed upon the information on this internet site.</span><br />\n	<br />\n	<span style=\"font-weight: normal;\">You agree to the terms and conditions outlined in this Terms of Use (\"Terms of Useâ€) with respect to www.payrentz.com (\"PayRentz\"/\"Website\"). These Terms of Use constitute the entire and only agreement between us and you, and supersedes all prior or contemporaneous agreements, representations, warranties and understandings with respect to the Website, the content, products or services provided by or through the Website. This Terms of Use may be amended from time to time by us without specific notice to you. The latest Terms of Use will be posted on the Website, and you should review this Terms of Use prior to using the Website at each instance. For the purpose of these Terms of Use, wherever the context so requires \"You\" or \"User\" shall mean any natural or legal person who has agreed to become a subscriber on the Website by providing information on the Website using the computer systems. There is no mandatory registration process and PayRentz allows the User to surf the Website or subscribe without registering on the Website. The term \"We\", \"Us\", \"Our\" shall mean the firm.</span><br />\n	<br />\n	<span style=\"font-weight: normal;\">When you use the Website or send emails or other data, information or communication to us, you agree and understand that you are communicating with us through electronic records and you consent to receive communications via electronic records from us periodically and as and when required. We may communicate with you by email or by such other mode of communication, electronic or otherwise. If you provide PayRentz with information (such as text, photos or images) when using this site you warrant that you are entitled to provide and license the information and you license PayRentz to use, reproduce, modify and publish the information. The information on this site is subject to change without notice.</span><br />\n	<br />\n	<span style=\"font-weight: normal;\">You shall not make any negative, denigrating or defamatory statement(s) or comment(s) about the firm or the brand name or domain name used by us including the terms PayRentz, PayRentz Rental Solutions, payrentz.com or otherwise engage in any conduct or action that might tarnish the image or reputation, of PayRentz or otherwise tarnish or dilute any PayRentz\'s trade or service marks, trade name and/or goodwill associated with such trade or service marks, trade name as may be owned or used by us. You may not use the Website or any content for any purpose that is unlawful or prohibited by these Terms of Use, or to solicit the performance of any illegal activity or other activity which infringes the rights of the Firm.</span><br />\n	<br />\n	<span style=\"font-weight: normal;\">For any questions or comments on this website and In accordance with Information Technology Act 2000 and rules made there under, the contact details of the officer are provided below:</span><br />\n	<br />\n	<span style=\"font-weight: normal;\">The Privacy Officer</span><br />\n	PR Rental Solutions Pvt Ltd<br />\n	<span style=\"font-weight: normal;\">24/53, Eldams Road, Teynampet, Chennai â€“ 600018.</span><br />\n	<span style=\"font-weight: normal;\">Phone: +91 89395 81818 (or) +91 99625 81818</span><br />\n	<span style=\"font-weight: normal;\">Email: feedback@payrentz.com<br />\n		</span><br />\n	PayRentz Social Media Terms of Use<br />\n	<br />\n	<span style=\"font-weight: normal;\">All users of our Social Media sites agree to the Terms and Conditions which prohibit inappropriate comments.</span><br />\n	<br />\n	<span style=\"font-weight: normal;\">For the purpose of users creating content on our sites, we define inappropriate use as:</span><br />\n	<br />\n	\n	<ul>\n		<li>Libels or defames</li>\n		<li>Obscene</li>\n		<li>Pornographic</li>\n		<li>Abusive</li>\n		<li>Threatening</li>\n		<li>Infringes the intellectual property rights of any other person including (without limitation) infringing any person\'s copyright or trademark</li>\n		<li>Illegal</li>\n		<li>Advocates illegal activity</li>\n		<li>Advertises or solicits funds or is a solicitation for or offer to supply goods or services<br />\n			</li>\n	</ul><span style=\"font-weight: normal;\"><br />\n		Any comment that falls under any of the above categories will be deleted. The PayRentz Marketing Department will take necessary steps on best effort basis to send a private message to the person stating why their comment or post was deleted.</span><br />\n	<br />\n	</h3>","","3","Terms of Use - Payrentz","Terms of Use","Terms of Use","2017-10-13","Y","1");
INSERT INTO tbl__tlink VALUES("4","2","Privacy Policy","privacy-policy","<span style=\"font-weight: bold;\">Privacy Policy<br />\n	</span><br />\nwww.payrentz.com is a website owned and operated by PayRentz Rental Solutions (\"PayRentzâ€) a firm duly incorporated under The Indian Partnership Act and is currently located at 24/53, Eldams Road, Teynampet, Chennai â€“ 600018. PayRentz is strongly committed to protecting the privacy of your personal information.<br />\n<br />\nWhen this privacy policy refers to PayRentz, we or us, we mean the companies that make up the PayRentz Group and which are specified in this privacy policy. This privacy policy applies to PayRentz and its privacy practices in India. The Website is owned by an Indian firm and is located in India. Hence, we are duty bound to abide by the laws, regulations, rules, circulars, notifications etc governing privacy in India. This Privacy Policy is applicable to all users of this Website. The user is herein collectively referred to as \"Youâ€. You may note that this Privacy Policy may be found deficient with respect to certain privacy laws of some other countries.<br />\n<br />\nPayRentz has taken all necessary and reasonable measures to protect your personal information and handle the same in a safe and responsible manner in accordance with the terms and conditions of this policy (\"Privacy Policyâ€) set out herein below.<br />\n<br />\n\"Personal information\" is any information that identifies you or that can reasonably enable your identification. This privacy policy provides you with information about how we manage your personal information, including certain types of credit-related personal information (credit information), and how you may contact us if you have any privacy concerns. In addition to this privacy policy we may on sometimes provide specific notifications about how we use particular personal information that we collect.<br />\n<br />\n<span style=\"font-weight: bold;\">The kinds of information we collect and hold<br />\n	</span><br />\nThe kinds of personal information that we collect and hold about you will depend on your interaction with us (e.g. online, in person or over the phone).<br />\n<br />\nThe types of personal information we collect and hold about you include:<br />\n<br />\n\n<ul>\n	<li>Your name, contact details (including your current and previous address), date of birth, gender and email address;</li>\n	<li>Information about your use of our services and products;</li>\n	<li>Employment information;</li>\n	<li>Information contained in credit reports obtained from credit reporting bodies, which includes information about your credit history with other credit providers;</li>\n	<li>Scores, ratings, summaries, evaluations and other information relating to your credit worthiness which is derived by us or by credit reporting bodies wholly or partly from any of the information above;</li>\n	<li>Bank account details; and</li>\n	<li>Identification documents.<br />\n		</li>\n</ul><br />\n<span style=\"font-weight: bold;\">We share your personal information as described below:<br />\n	</span><br />\nBusiness Transfers: If we start up subsidiaries or involve in mergers or acquisitions. In such case your Personal Information may be the matter of transfer. And we will provide notice on any such transfer and become subject to different privacy policy.<br />\n<br />\nRequirement under law: We release your Personal Information to third parties under following circumstances:<br />\n<br />\n\n<ul>\n	<li>To comply with the law, legal process or an enforceable governmental request;</li>\n	<li>To enforce or apply our terms of use or other agreements with you;</li>\n	<li>To protect the rights or safety of Website or our users or others. However, transfer under this case does not include selling, renting, sharing, or otherwise disclosing your Personal Information for commercial purposes in violation of the commitments set forth in this Privacy Policy<br />\n		</li>\n</ul><br />\nWe may also be required by law to collect your personal information. These laws include anti-money laundering and counter-terrorism financing legislation, national consumer credit protection legislation, personal properties securities legislation, as well as taxation and corporations laws. We will tell you if this is the case and let you know the details of the applicable law, court or tribunal order.<br />\n<br />\nIf we cannot collect your personal information we may not be able to provide you with the services and products or assistance (or certain features) you require. The collection, use or disclosure of your personal information is needed to provide these.<br />\n<br />\nYou may have the option, if it is lawful and practicable, to remain anonymous or use a name other than your own (a \"pseudonymâ€) when you deal with us, For example, when you make a general inquiry about our services or products. However, you wonâ€™t be able to remain anonymous or use a pseudonym if you want to rent or buy goods from us or if you would like to work with us. We need to be able to identify you.<br />\n<br />\n<span style=\"font-weight: bold;\">How do we collect your personal information?<br />\n	</span><br />\nWe collect your personal information as much as possible directly from you or from persons acting on your behalf, including when you complete our forms, call or email us or in our ongoing dealings with you. For example, we will collect information internally from your transactions in connection with credit, such as when you make payments to us. We may also collect personal information about you from publicly available sources, and in some cases, from third parties including:<br />\n<br />\n\n<ul>\n	<li>Debt collection agencies;</li>\n	<li>Your referees (including your employer, your landlord);</li>\n	<li>Government, statutory, regulatory or enforcement bodies;</li>\n	<li>Credit reporting bodies;</li>\n	<li>Other lessors or credit providers (including for references and collections activities);</li>\n	<li>Your employer; and</li>\n	<li>Any other person or organization that you have asked us to collect your personal information from.</li>\n</ul><br />\n<span style=\"font-weight: bold;\">Use and disclosure of your personal information<br />\n	</span><br />\nWe use and disclose your personal information for the purposes we collected it and for related purposes (where you would reasonably expect us to). We may collect, hold, use and disclose your personal information for the following general purposes:<br />\n<br />\n\n<ul>\n	<li>Identifying you and carrying out appropriate checks to assess applications for credit (including assessing any proposed guarantors</li>\n	<li>Understanding your requirements and needs and how you interact with us, so that we can carry out product development, service research and develop our business strategies around providing you with our products or services;</li>\n	<li>Managing, including recovering, outstanding debts;</li>\n	<li>Undertaking secularization activities and debt assignments;</li>\n	<li>Enabling us to participate in the credit reporting system (including providing information to credit reporting bodies);</li>\n	<li>Establishing, administering and managing our services (including our accounts and agreements with you) and products;</li>\n	<li>Managing and training our employees and representatives;</li>\n	<li>Promoting and marketing our products and services to you;</li>\n	<li>Managing complaints and disputes; and</li>\n	<li>Meeting our legal and regulatory obligations (such as reporting matters to regulators or enforcement bodies when authorized or required by law).</li>\n</ul><br />\nSome credit information may only be used or disclosed under the Privacy Act for some of these purposes or in some circumstances. If we need to use or disclose your personal information for a purpose that is not set out in our privacy policy, or that is unrelated to the purpose for which we collected your personal information, we will obtain your consent first. We may ask for your express consent or your consent may be implied by an action you take (or donâ€™t take). There are a range of people and organizations we disclose your personal information to. The particular party we may disclose your personal information to will depend on the dealings you have with us. Some examples of the parties to whom we may disclose your personal information include to:<br />\n<br />\n\n<ul>\n	<li>Advisors and consultants (including our accountants, auditors and lawyers);</li>\n	<li>Financial institutions;</li>\n	<li>Third party services providers with whom we have contracted to provide services, for example, IT service providers, marketing services providers, auditors, business management consultants, mail and document management service providers;</li>\n	<li>Product manufacturers;</li>\n	<li>Debt collections agencies;</li>\n	<li>Government, statutory, regulatory or enforcement bodies;</li>\n	<li>External dispute resolution schemes;</li>\n	<li>Credit reporting bodies;</li>\n	<li>Other lessors or credit providers (including for references and collections activities);</li>\n	<li>Any other person or organisation that you have asked us to provide your personal information to; and</li>\n	<li>Any other organisation considering whether to acquire (or that has acquired) an interest in our business or any rights under your rental agreement or rent to own agreement with us.<br />\n		</li>\n</ul><br />\nWe seek to limit the information we provide these organizations to the minimum that they need to perform their services or activities for us or for you.<br />\n<br />\n<span style=\"font-weight: bold;\">Marketing<br />\n	</span><br />\nWe use personal information that we hold about you to identify services and products that may be of interest to you. We may contact you by email, text message, phone or by post to let you know about specials, our promotions or any new or existing products or services. We also use internet-based marketing including targeted online advertising and online behavioral marketing. We may also disclose your personal information in future to other PayRentz group companies, affiliates, franchisees to allow them (or us) to tell you about a product or service. Our marketing agencies may contact you using information about you that they already hold, or we may provide your personal information to them, in order to serve you with more relevant advertising about our services and products. You can contact us (see details below) at any time if you no longer wish to receive marketing materials from us or affiliates or our partners.<br />\n<br />\n<span style=\"font-weight: bold;\">How we keep your information secure<br />\n	</span><br />\nWe understand the importance of protecting your personal information including credit information, and mostly hold this information electronically in our IT systems, secure servers and databases. We may use third party service providers to store and process some personal information. These may include Indian and internationally-based technology service providers and the use of servers of third parties within and outside India. We take steps and precautions to safeguard your personal information from loss, misuse, unauthorized access, modification or disclosure. We do this through a number of ways including:<br />\n<br />\n\n<ul>\n	<li>Securing information both in physical and electronic form;</li>\n	<li>Having internal procedures and measures limiting access to personal information to only those who need access for their legitimate activities; and</li>\n	<li>Protecting our IT systems by using appropriate technology solutions.</li>\n</ul><br />\nWe may be required by law to retain your personal information for a period of time after you have ceased your relationship with us. After such time has passed or if we otherwise determine that we no longer need information about you, we will securely destroy or de-identify your personal information. We will take reasonable technical and organizational precautions to prevent the loss, misuse or alteration of your personal information. We assure you of our best effort to protect personal information, however, we do not represent, warrant, or guarantee that your personal information will be protected against unauthorized access, loss, misuse, or alterations, and do not accept any liability for the security of the personal information submitted to us or third parties\' use or misuse of personal information.<br />\n<br />\n<span style=\"font-weight: bold;\">Will we disclose your personal information overseas?<br />\n	</span><br />\nSome of our technology and operational service providers may be placed overseas in future if required. This means that when we decided to use these providerâ€™s services, it may involve disclosing your personal information overseas. We only disclose personal information to our overseas service providers when it is necessary.<br />\n<br />\n<span style=\"font-weight: bold;\">Using other websites<br />\n	</span><br />\nYou should note that our website may contain links or references to other websites to which this privacy policy may not apply. You should review the privacy policy of each of those websites and assess whether those policies are acceptable to you before using those websites.<br />\n<br />\n<span style=\"font-weight: bold;\">Cookies<br />\n	</span><br />\nWe use cookies and web-tracking tools on our website to identify generic behavioral patterns on use of our website and to compile data that can help us improve the content and functionality of our website. A \"Cookie\" is a piece of information that a web site sends to your browser. Cookies are used to add functionality, track web site usage and enable us to \"personalize\" your visits to our site. Cookies do not in themselves identify you; rather they identify your computer\'s browser. Most web browsers are set to accept Cookies however if you do not wish to receive Cookies you may set your browser to refuse them (this may result in you not being able to access parts of our site).<br />\n<br />\nWhen you browse our site we may collect and log the following types of information (\"Click stream data\") including without limitation:<br />\n<br />\n\n<ul>\n	<li>the date and time that you visit our site;</li>\n	<li>the amount of time you spend on our site;</li>\n	<li>the particular pages that you visit;</li>\n	<li>the type of browser you use;</li>\n	<li>the address of your server;</li>\n	<li>the address of the site that you have connected from;</li>\n</ul><br />\nPayRentz does not use the click stream data or Cookies to personally identify you. We use the data on an aggregated and anonymous basis for purposes which include generating statistics, managing the effectiveness of our site, identifying repeat visitors, building anonymous profiles of visitors to enable content (including advertising and promotions) on the site to be tailored to them and for market research.<br />\n<br />\n<span style=\"font-weight: bold;\">Keeping your information up-to-date<br />\n	</span><br />\nIt is very important that the personal information we collect and hold about you is accurate, complete and up-to-date. During the course of our relationship with you we will ask you to keep us informed of any changes to your personal information. However, you can contact us (details provided in the website) at any time to update your personal information or to tell us that the information we hold about you is in any way inaccurate or incomplete.<br />\n<br />\n<span style=\"font-weight: bold;\">How you can access your personal information<br />\n	</span><br />\nYou may request access to, and the correction of, any of the personal information we hold about you by contacting us as set out below:<br />\n<br />\n<span style=\"font-weight: bold;\">Phone:</span> +91 89395 81818 (or) 044 48638090<br />\n<br />\n<span style=\"font-weight: bold;\">Email:</span> service@payrentz.com<br />\n<br />\nWhen you contact us and request access to your personal information, we will need to verify your identity first and ask you further questions so that we can respond to your request as quickly as possible. We canâ€™t give you information about anyone else.<br />\n<br />\nWe will handle all requests for access to your personal information as quickly as possible, and we will endeavor to process any such requests within short span of time. Some requests for access may take longer to process depending upon the nature of the personal information being sought.<br />\n<br />\nMaking a request is free. But in some instances we may charge you a fee to cover the cost of retrieval and supply of information to you. The fee will not be excessive, and we will let you know if a fee will apply before we proceed with giving you access.<br />\n<br />\nThere may be reasons why we cannot give you access to the information that you have requested, or we refuse to correct your personal information. If this is the case, we will let you know these reasons in writing. If we refuse you access or to correct your personal information, you can make a complaint about this, by following the complaint procedures in this privacy policy.<br />\n<br />\n<span style=\"font-weight: bold;\">Complaints, Queries and Feedback<br />\n	</span><br />\nIf you have any questions or feedback about this Privacy Policy or Website treatment of your Personal Information or concerns about our collection, use or disclosure of personal information, or if you believe that we have not complied with this privacy policy or the Privacy Act, please contact us as below.<br />\n<br />\nThe Privacy Officer<br />\nPR Rental Solutions Pvt Ltd.,<br />\n24/53, Eldams Road, Teynampet, Chennai â€“ 600018.<br />\nPhone: +91 89395 81818 (or) 044 48638090<br />\nEmail: feedback@payrentz.com<br />\n<br />\nWhen contacting us, please provide as much detail as possible in relation to the query, issue or complaint. We will take your complaint seriously and it will be assessed by an appropriate person with the aim of resolving any issue in a timely and efficient manner. We ask that you cooperate with us during this process and provide us with relevant information we may require. All disputes between us and you in this regard are subject to exclusive jurisdiction of Chennai courts.<br />\n<br />\n<span style=\"font-weight: bold;\">Changes to this privacy policy<br />\n	</span><br />\nWe conduct regular reviews of all our policies and procedures and may change this privacy policy from time to time. By continuing to use our website or otherwise continuing to deal with us, you accept this privacy policy as it applies from time to time. Any changes to our privacy policy will be published on our website. So please check our website regularly for any updates to our privacy policy.<br />\n","","4","Privacy Policy - Payrentz","Privacy of individual visitor data is of primary importance to Meini. We work diligently to protect confidentiality, restrict transfer of personal data.","privacy policy, data privacy,  privacy law","2017-10-13","Y","1");
INSERT INTO tbl__tlink VALUES("5","2","About Us","about-us","\n<h3><span style=\"font-size: 12pt;\">About PayRentz&nbsp;<br />\n		<br />\n		<span style=\"font-weight: normal;\">PayRentz specializes in providing rental solutions to clients by offering a wide range of Appliances, Home Entertainment, Furniture and Fitness Products apart from other customized requirements. Whatever may be your rental needs, PayRentz has it covered with a solution tailored for you. Our objective is to make life easy for clients by offering customized rental solutions which includes speedy delivery, free transportation, free standard installation, flexible payment options and prompt service delivery.</span><br />\n		<br />\n		<span style=\"font-weight: normal;\">PayRentz is founded and run by a team of professionals who quit lucrative corporate careers after working with top financial institutions and software companies for more than a decade. PayRentz aims to become the leading and preferred rental solutions provider in the country. Each member of the founding team has taken individual responsibility of Sales, Credit, Operations and Service to ensure that all the said functions are given its due attention to achieve remarkable client experience.</span><br />\n		<br />\n		<span style=\"font-weight: normal;\">Be it big or small, Home is a place where people rejuvenate themselves on a daily basis and we endorse that a great home is the key to the success of every individual. In the process of creating a great home, we partner with our clients, help them make an informed choice and shoulder the responsibility of furnishing and transforming the place. We do this job well and usually land up creating a feel good environment at home to suit an individualâ€™s style and needs.</span></span><br />\n	</h3>","","5","About Us - Payrentz","","","2017-12-24","Y","1");
INSERT INTO tbl__tlink VALUES("6","2","Why Rent","why-rent","<span style=\"font-weight: bold;\">Why Rent</span><br />\n<br />\nWondering whether rental is advisable? Absolutely. Renting is a great idea and the new mantra, we tell you why. Go for it.<br />\n<br />\n<span style=\"font-weight: bold;\">Helps your wallet<br />\n	</span><br />\nRenting eliminates the upfront costs of buying products and helps you to maintain liquidity and healthy cash flow. You pay monthly rent to PayRentz for the products rented as you pay for your monthly utility bills. Renting with PayRentz also means that you need not postpone your decision to posses the desired product of your choice.<br />\n<br />\n<span style=\"font-weight: bold;\">Rent to Own<br />\n	</span><br />\nWe strive to make sure you have a remarkable experience with our product at all times. As a distinct advantage with PayRentz, you can choose to own the product after a minimum rental period of 3 months. Exercising the option to buy provides you continuity of product and at a price that is reasonable and attractive. As an additional benefit, we would continue to provide service support for a period of 6 months from the time you buy the product.<br />\n<br />\n<span style=\"font-weight: bold;\">Saves Time<br />\n	</span><br />\nIn the process of finding the right product and model, are you researching all available ecommerce portals for a great deal and burning your time or your family time? Stop! Call PayRentz and leave the problem to us. We help you to make an informed choice quickly and furnish your place to your expectation.<br />\n<br />\n<span style=\"font-weight: bold;\">Service and Maintenance<br />\n	</span><br />\nImagine the hassles of talking to multiple call centre executives and requesting them for servicing your various products, not everybody likes it and has the luxury of time. Rent from PayRentz and call us for any service issues on our products. Our service team will attend to the issues at your convenience.<br />\n<br />\n<span style=\"font-weight: bold;\">Replacement</span><br />\n<br />\nWhat more? PayRentz will provide an alternate product in the interim, if our service team identifies an issue which requires more time to resolve. We believe that our clients should have uninterrupted experience of the products rented from PayRentz.<br />\n<br />\n<span style=\"font-weight: bold;\">People on the Move<br />\n	</span><br />\nTake on the lifeâ€™s challenge of tossing you from once place to another. Leaving home for a new place, relocating often? PayRentz is here to help. You can have what you need now and choose to rent for a period that suits you.<br />\n<br />\n<span style=\"font-weight: bold;\">Upgrade Periodically<br />\n	</span><br />\nGone are those days where you grew up with the same TV or Refrigerator for years together. With technology moving at such a rapid pace, renting makes perfect sense. Why buy when it could be outdated in a couple of years.<br />\n<br />\n<span style=\"font-weight: bold;\">Happy Family<br />\n	</span><br />\nNeed a second TV or Microwave or Refrigerator for your parents or children or yourself? Renting is the obvious choice, since the additional rental product offered by PayRentz can be returned after the desired rental period.<br />\n<br />\n<span style=\"font-weight: bold;\">Gift your loved ones<br />\n	</span><br />\nNow, you need not wait to see your loved ones smile. Rent a desired product immediately than postponing the decision to purchase it. Call PayRentz to install the rental product for your family even if you are abroad or away on work. Planning to donate products for a cause (Home for Children, Old age home, Community gym, Contribution to alma mater etc), you need not necessarily buy, you can rent it too. Call PayRentz to install and manage the rental product on your behalf.<br />\n\n<h2></h2>","","6","Why Rent - Payrentz","","","2017-12-24","Y","1");
INSERT INTO tbl__tlink VALUES("7","2","How It Works","how-it-works","<span style=\"font-weight: bold;\">How it Works<br />\n	<br />\n	</span>Our objective is to make life simple and easy for clients. Browse our website, identify the products of your choice and then reach out to us. You may choose to call us / send an email / fill your details in the contact us page. We will promptly initiate a dialogue to understand your requirements and initiate process to fulfill the same. Our representative will meet you in person to complete the application and documentation procedure. Once the application is screened and approved by our credit team, we will check on your convenience to deliver and install the product.<br />\n<br />\n<span style=\"font-weight: bold;\">When and where do you deliver?<br />\n	</span><br />\nPayRentz delivers products only at the address provided in the application. We deliver the products within 2-3 business days from the time of order confirmation and PayRentz credit team approval.<br />\n<br />\n<span style=\"font-weight: bold;\">Should I be present for delivery and installation?<br />\n	</span><br />\nPayRentz advises you / your authorized representative to be present during delivery and installation. We will manage the delivery and installation at your convenience. A confirmation on the condition report of the product will be obtained by the executive upon successful delivery and installation from you or your authorized representative.<br />\n<br />\n<span style=\"font-weight: bold;\">Who is responsible for products delivered with damage?<br />\n	</span><br />\nWe do a thorough quality check at our site before dispatch of products for delivery. In case of a highly unlikely event of damages incurred in transit, PayRentz will refrain from installing the same and furnish a new product. Your confirmation will be obtained by the executive upon successful delivery and installation.<br />\n<br />\n<span style=\"font-weight: bold;\">What is covered as part of standard delivery and installation?<br />\n	</span><br />\nPayRentz, as a policy is committed to offer free standard delivery and installation of products. Standard delivery means delivery of the products to your premises. If your building has lift and our team is granted permission to use it for delivery it will still be considered as standard delivery. Labor charges apply at actuals to deliver products in case of denial of permission to use lift or absence of lift.<br />\n<br />\nStandard installation means placement of products in working condition at the designated place in your home. Charges will apply to any deviation to the standard installation. For Eg: Specific request to install TV on the wall, iron angle or additional tubes requirement for outdoor AC unit, additional plumbing or electrical work for appliances installation are all not part of the standard installation process. PayRentz executive will explain the standard delivery and installation capabilities before you sign the application. Please feel free to talk to our representative for more details. Assuring you the best of services always.<br />\n<br />\n<span style=\"font-weight: bold;\">How do I refer a friend and is there a reward for referral?<br />\n	</span><br />\nYou could earn an attractive gift voucher worth Rs. 250/- for every person you refer to us. Once your friendâ€™s application is successful and he/she enrolls as a PayRentz customer, we will send the gift voucher in person or through courier. Referrals can be made through phone or email or by filling up your details and that of your friend in our contact us page.<br />\n\n<h2></h2>","","7","How It Works - Payrentz","","","2017-12-24","Y","1");
INSERT INTO tbl__tlink VALUES("8","2","FAQ How It Works","faq-how-it-works","\n<h3><span style=\"font-size: 12pt;\">Frequently Asked Questions<br />\n		<br />\n		<span style=\"font-weight: normal;\">What is the minimum rental period?<br />\n			<br style=\"font-size: 12pt;\" />\n			</span><span style=\"font-weight: normal;\">PayRentz products can be rented for a minimum period of 3 months.</span><br />\n		<br />\n		Is there an agreement?<br />\n		<br />\n		<span style=\"font-weight: normal;\">Yes, you need to sign the terms and conditions provided along with the application form.</span><br />\n		<br />\n		How can I terminate the rental agreement?<br />\n		<br />\n		<span style=\"font-weight: normal;\">You may choose to discontinue the service after a period of 3 months. PayRentz requests its client to provide a minimum of 15 days prior notice to facilitate a hassle free settlement.</span><br />\n		<br />\n		How much rent do I need to pay and when?<br />\n		<br />\n		<span style=\"font-weight: normal;\">Clients are encouraged to pay rent for the products on or before 7th of every month. Kindly refer to the product categories listed along with rent details in the website. Rent will be communicated without any ambiguity at the time of delivery and it will be documented in the application form.</span><br />\n		<br />\n		How much should I pay as advance?<br />\n		<br />\n		<span style=\"font-weight: normal;\">Clients will pay a refundable deposit which is equal to 3 months rent of the product chosen (varies according to each product) and Onetime non refundable processing charges of Rs. 500/- per product.</span><br />\n		<br />\n		Do I get rewards for referring a friend to PayRentz?<br />\n		<br />\n		<span style=\"font-weight: normal;\">You could earn an attractive gift voucher worth Rs. 250/- for every person you refer to us. Once your friendâ€™s application is successful and he/she enrolls as a PayRentz customer, we will send the gift voucher in person or through courier. Referrals can be made through phone or email or by filling up your details and that of your friend in our contact us page.</span><br />\n		<br />\n		Are there any other charges apart from rent, processing charges and refundable deposit?<br />\n		<br />\n		<span style=\"font-weight: normal;\">No.</span><br />\n		<br />\n		When will I get my refundable deposit?<br />\n		<br />\n		<span style=\"font-weight: normal;\">Refundable deposit will be returned to you after the end of contact period or return of the product as the case may be. The returned products are subjected to quality check either at your place or at our office depending on the availability of our engineers. Upon clearance from quality team the rental deposit will be transferred to your account with one week. Any cost arising out of damages other than normal wear and tear will be deducted from the deposit.</span><br />\n		<br />\n		How can I pay the rent?<br />\n		<br />\n		<span style=\"font-weight: normal;\">Our collection executives will visit your place on or before 7th of every month to collect cash or cheque at your convenience.</span><br />\n		<br />\n		When can I expect the delivery of the product?<br />\n		<br />\n		<span style=\"font-weight: normal;\">Once you submit the application along with required information and supporting documents, speedy credit verification and approval process is initiated. Our average delivery timeline is 3-5 business days from the date of application.</span><br />\n		<br />\n		Who will take care of the installation?<br />\n		<br />\n		<span style=\"font-weight: normal;\">PayRentz team will take care of standard installation. Any additional effort (no lift) towards delivery and customization on installation will be at additional cost to be borne by the client. Please speak to the executive while submitting the application for more details.</span><br />\n		<br />\n		<br />\n		What are the documentation requirements?<br />\n		<br />\n		<span style=\"font-weight: normal;\">PayRentz requests clients to submit copy of standard KYC documents covering ID proof, address proof (permanent and current address) and company ID card along with duly completed application form. We request you to show the original document to the executive while signing the application which enables speedy verification and approval.</span><br />\n		<br />\n		Can I continue the service when I relocate?<br />\n		<br />\n		<span style=\"font-weight: normal;\">PayRentz currently operates in Chennai. Relocation of products is to be handled only by PayRentz team. Clients are advised to inform us 15 days in advance to help you in relocation. Kindly note appropriate documentation requirements and relocation charges will apply.</span><br />\n		<br />\n		Can I rent your products for a short period?<br />\n		<br />\n		<span style=\"font-weight: normal;\">The minimum rental period of products is 3 months. On a standardized basis, you may choose to terminate the agreement during this period. In such an event, PayRentz would retain the initial deposit. Pro-rata rent for the month and onetime processing charges as applicable would be charged. You may choose to call us for any specific requirements. We will be happy to explore other possibilities.</span><br />\n		<br />\n		Is there a penalty applicable for any damage?<br />\n		<br />\n		<span style=\"font-weight: normal;\">In the event of an unintentional damage to any of our products, please do call us and lodge a service request with details of damage. We advise you to not engage any other service engineer which is considered as breach of the agreement. Cost of repair / damage to be borne by the client at actuals. Cost of product will be recovered in the event of any irreparable damages or at the sole discretion of PayRentz. We take pictures of the products upon installation which mutually helps at the time of product return.</span><br />\n		<br />\n		Can I buy the product from PayRentz during the rental period?<br />\n		<br />\n		<span style=\"font-weight: normal;\">Yes. As a distinct advantage with PayRentz, you can choose to own the product after a minimum rental period of 3 months. Exercising the option to buy provides you continuity of product and at a price that is reasonable and attractive. As an additional benefit, we would continue to provide service support for a period of 6 months from the time you buy the product.</span><br />\n		<br />\n		How do I register a complaint or feedback?<br />\n		<br />\n		<span style=\"font-weight: normal;\">Please call us at +91 89395 81818 (or) 044 48638090 from 10am to 7pm on all working days or email us at feedback@payrentz.com</span><br />\n		<br />\n		Can my friend or nominee take over my rental product?<br />\n		<br />\n		<span style=\"font-weight: normal;\">Yes, please inform us 15 days in advance to execute necessary documentation and activate the new client profile.</span><br />\n		<br />\n		What should I do in case of a service / maintenance request?<br />\n		<br />\n		<span style=\"font-weight: normal;\">Please feel free to reach us for a service request. Ongoing service / maintenance will be managed by us at no additional cost. Cost of spares and damage to be borne by the client at actuals. Depending on the lead time for service in case of a repair, we will attempt to provide a replacement until your product is ready.</span><br />\n		<br />\n		Are my personal details maintained with you safe?<br />\n		<br />\n		<span style=\"font-weight: normal;\">Yes, we deal with your details with utmost confidentiality. Your personal details will not be shared with anybody.</span><br />\n		<br />\n		What is my deliverable on maintenance of the product?<br />\n		<br />\n		<span style=\"font-weight: normal;\">We expect you to handle the products with care as it avoids issues and provides uninterrupted service. Please note our clients also choose to buy the same product during the rental period and hence a proper care helps.</span><br />\n		<br />\n		What is the average time to complete your approval process?<br />\n		<br />\n		<span style=\"font-weight: normal;\">We would endeavor to complete the approval process and deliver of the product within 3-5 working days upon receipt of your application complete in all respects.</span><br />\n		<br />\n		I want to rent more products, what should I do?<br />\n		<br />\n		<span style=\"font-weight: normal;\">We will be happy to hear your request. We will be able to deliver the products faster for existing clients. Kindly note onetime Processing charges of Rs. 500/- apply per product.</span><br />\n		</span><br />\n	</h3>","","8","FAQ How It Works - payrentz","","","2017-12-24","Y","1");
INSERT INTO tbl__tlink VALUES("9","2","FAQ Delivery & Installation","faq-delivery-and-installation","\n<h3>Gobi<br />\n	<br />\n	1. How do I learn more about a product?</h3>                    \n<p>In case you have questions about a product, please write to our customer care and we will get back to you within 24 hours. You can also chat with us between 10 AM to 8PM on our website by using the chat option.</p>                    \n                    \n<h3>2. How do I pay my deposit and rent?</h3>                    \n<p>Payments are super convenient with Payrentz. You can pay the entire deposit through your Payrentz dashboard at once or simply book the furniture with a token amount of INR 500 and pay the rest at the time of delivery through your credit/debit card. The option of book and pay is valid on cart value of INR 1000 and above. For your monthly rent, we will send a link on your registered email id and you can pay through your dashboard</p>                    \n                    \n<h3>3. What is the rental value I pay and when do I pay it?</h3>                    \n<p>Its simple! Select the products you like and you will see the total rental value in your cart. Rent is due on the 1st of every month and can be paid online through your Payrentz dashboard. Your first &amp; last month\'s rent is calculated on a pro-rata basis from the date of delivery. Billing cycle is 1st to last of that month.</p>                    \n                    \n<h3>4. Is there any contract? What are the terms?</h3>                    \n<p>We have a simple contract that you need to sign when the products arrive at your home. Contract includes basic terms of renting, payment, refund and damage policy. </p>                    \n                    \n<h3>5. What documents are required to get into the contract?</h3>                    \n<p>For our easy KYC process we require the below mentioned documents at the time of signing the contract.<br />\n	<br />\n	Photo ID proof(any one):Passport/PAN Card / Driving License / Aadhar Card.<br />\n	Address proof (Any one) : House rental agreement / Address proof on company letterhead / Govt. issued proof / Bank Statement. \nNOC from the owner if you are living in rented house.<br />\n	<br />\n	Yes, the document submission is mandatory. Rest assured, your details are safe with us :)</p>","","9","FAQ Delivery & Installation - Payrentz","","","2017-12-24","N","1");
INSERT INTO tbl__tlink VALUES("10","2","FAQ Rental Process & Tenure","faq-rental-process-and-tenure","<h3>1. How do I learn more about a product?</h3>                     <p>In case you have questions about a product, please write to our customer care and we will get back to you within 24 hours. You can also chat with us between 10 AM to 8PM on our website by using the chat option.</p>                                          <h3>2. How do I pay my deposit and rent?</h3>                     <p>Payments are super convenient with Payrentz. You can pay the entire deposit through your Payrentz dashboard at once or simply book the furniture with a token amount of INR 500 and pay the rest at the time of delivery through your credit/debit card. The option of book and pay is valid on cart value of INR 1000 and above. For your monthly rent, we will send a link on your registered email id and you can pay through your dashboard</p>                                          <h3>3. What is the rental value I pay and when do I pay it?</h3>                     <p>Its simple! Select the products you like and you will see the total rental value in your cart. Rent is due on the 1st of every month and can be paid online through your Payrentz dashboard. Your first & last month\'s rent is calculated on a pro-rata basis from the date of delivery. Billing cycle is 1st to last of that month.</p>                                          <h3>4. Is there any contract? What are the terms?</h3>                     <p>We have a simple contract that you need to sign when the products arrive at your home. Contract includes basic terms of renting, payment, refund and damage policy. </p>                                          <h3>5. What documents are required to get into the contract?</h3>                     <p>For our easy KYC process we require the below mentioned documents at the time of signing the contract.<br/><br/> Photo ID proof(any one):Passport/PAN Card / Driving License / Aadhar Card.<br/> Address proof (Any one) : House rental agreement / Address proof on company letterhead / Govt. issued proof / Bank Statement.  NOC from the owner if you are living in rented house.<br/><br/>  Yes, the document submission is mandatory. Rest assured, your details are safe with us :)</p>","","10","	 FAQ Rental Process & Tenure - Payrentz","","","2017-12-24","N","1");
INSERT INTO tbl__tlink VALUES("11","2","FAQ Refunds & Returns","faq-refunds-and-returns","<h3>1. How do I learn more about a product?</h3>                     <p>In case you have questions about a product, please write to our customer care and we will get back to you within 24 hours. You can also chat with us between 10 AM to 8PM on our website by using the chat option.</p>                                          <h3>2. How do I pay my deposit and rent?</h3>                     <p>Payments are super convenient with Payrentz. You can pay the entire deposit through your Payrentz dashboard at once or simply book the furniture with a token amount of INR 500 and pay the rest at the time of delivery through your credit/debit card. The option of book and pay is valid on cart value of INR 1000 and above. For your monthly rent, we will send a link on your registered email id and you can pay through your dashboard</p>                                          <h3>3. What is the rental value I pay and when do I pay it?</h3>                     <p>Its simple! Select the products you like and you will see the total rental value in your cart. Rent is due on the 1st of every month and can be paid online through your Payrentz dashboard. Your first & last month\'s rent is calculated on a pro-rata basis from the date of delivery. Billing cycle is 1st to last of that month.</p>                                          <h3>4. Is there any contract? What are the terms?</h3>                     <p>We have a simple contract that you need to sign when the products arrive at your home. Contract includes basic terms of renting, payment, refund and damage policy. </p>                                          <h3>5. What documents are required to get into the contract?</h3>                     <p>For our easy KYC process we require the below mentioned documents at the time of signing the contract.<br/><br/> Photo ID proof(any one):Passport/PAN Card / Driving License / Aadhar Card.<br/> Address proof (Any one) : House rental agreement / Address proof on company letterhead / Govt. issued proof / Bank Statement.  NOC from the owner if you are living in rented house.<br/><br/>  Yes, the document submission is mandatory. Rest assured, your details are safe with us :)</p>","","11","FAQ Refunds & Returns - Payrentz","","","2017-12-24","N","1");
INSERT INTO tbl__tlink VALUES("12","2","Rent To Own","rent-to-own","\n<h2>How it Works</h2><br />\nOur objective is to make life simple and easy for clients. Browse our website, identify the products of your choice and then reach out to us. You may choose to call us / send an email / fill your details in the contact us page. We will promptly initiate a dialogue to understand your requirements and initiate process to fulfill the same. Our representative will meet you in person to complete the application and documentation procedure. Once the application is screened and approved by our credit team, we will check on your convenience to deliver and install the product.<br />\n<br />\n\n<h4>When and where do you deliver?</h4>PayRentz delivers products only at the address provided in the application. We deliver the products within 2-3 business days from the time of order confirmation and PayRentz credit team approval.<br />\n<br />\n\n<h4>Should I be present for delivery and installation?</h4>PayRentz advises you / your authorized representative to be present during delivery and installation. We will manage the delivery and installation at your convenience. A confirmation on the condition report of the product will be obtained by the executive upon successful delivery and installation from you or your authorized representative.<br />\n<br />\n\n<h4>Who is responsible for products delivered with damage?</h4>We do a thorough quality check at our site before dispatch of products for delivery. In case of a highly unlikely event of damages incurred in transit, PayRentz will refrain from installing the same and furnish a new product. Your confirmation will be obtained by the executive upon successful delivery and installation.<br />\n<br />\n\n<h4>What is covered as part of standard delivery and installation?</h4>PayRentz, as a policy is committed to offer free standard delivery and installation of products. Standard delivery means delivery of the products to your premises. If your building has lift and our team is granted permission to use it for delivery it will still be considered as standard delivery. Labor charges apply at actuals to deliver products in case of denial of permission to use lift or absence of lift.Standard installation means placement of products in working condition at the designated place in your home. Charges will apply to any deviation to the standard installation. For Eg: Specific request to install TV on the wall, iron angle or additional tubes requirement for outdoor AC unit, additional plumbing or electrical work for appliances installation are all not part of the standard installation process. PayRentz executive will explain the standard delivery and installation capabilities before you sign the application. Please feel free to talk to our representative for more details. Assuring you the best of services always.<br />\n<br />\n\n<h4>How do I refer a friend and is there a reward for referral?</h4>You could earn an attractive gift voucher worth Rs. 250/- for every person you refer to us. Once your friendâ€™s application is successful and he/she enrolls as a PayRentz customer, we will send the gift voucher in person or through courier. Referrals can be made through phone or email or by filling up your details and that of your friend in our contact us page.\n","","7","How It Works - Payrentz","","","2017-12-24","N","1");



